Step-by-step reasoning:
1. Key psychological mechanisms: Responders compare the offered amount (split_self) to a fairness benchmark derived from their relative token contribution. When the offer falls below the fair share, they suffer a penalty that increases with the squared relative shortfall. Offers that meet or exceed their fair share do not incur this penalty.

2. Mechanism interactions: The model sums a baseline “attractiveness” term (mu) and the offered monetary share. It then subtracts a penalty (scaled by lambda_param) that depends on the square of the shortfall between the fair share – computed as combined_earning×(token_self/(token_self+token_opp)) – and the actual offer. Importantly, the penalty is normalized by the fair share, so that deviations are careful to account for varying combined earnings across trials.

3. Mathematical form: Define the fairness benchmark r = combined_earning×(token_self/(token_self+token_opp)). Then define the shortfall as max(r – split_self, 0). The penalty is the square of the shortfall divided by r. Finally, the utility for accepting an offer is:
  U = mu + split_self − lambda_param × ((max(r − split_self, 0))² / r)

4. Learnable parameters: There are two learnable parameters:
 • mu: A baseline utility or bias in favor of acceptance.
 • lambda_param: The sensitivity to fairness violations (the penalty for receiving less than the fair share).

5. Mapping to observable behavior: In each trial for responders, the observed split_self, combined_earning, token_self, and token_opp are used to compute a fairness benchmark (r). The offered split_self yields a reward component, but if it is lower than r it is penalized quadratically (normalized by r) in accordance with the fairness shortfall. The resulting utility (U) quantifies the attractiveness of accepting the offer (with negative utilities corresponding to unlikely actions).

Below is the formal specification:

